import React from "react";

class RowControl extends React.Component {
  render() {
    return (
      <div>
        <button class="ui edit button">
          <i class="cloud icon" />
        </button>

        <button class="ui delete button">
          <i class="cloud icon" />
        </button>
      </div>
    );
  }
}

export default RowControl;
